/*Table structure for table `zy_log` */

DROP TABLE IF EXISTS `zy_log`;

CREATE TABLE `zy_log` (
  `Id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `Openid` varchar(50) DEFAULT NULL,
  `ErrorCode` int(5) DEFAULT NULL COMMENT '错误代码',
  `Msg` varchar(100) DEFAULT NULL COMMENT '错误信息',
  `Browser` varchar(50) DEFAULT NULL COMMENT '浏览器',
  `Ip` varchar(30) DEFAULT NULL COMMENT 'IP',
  `ComeFrom` varchar(200) DEFAULT NULL COMMENT '来源地址',
  `AddTime` varchar(20) DEFAULT NULL COMMENT '记录时间',
  PRIMARY KEY (`Id`),
  KEY `NewIndex1` (`Openid`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

