/*Table structure for table `zy_player` */

DROP TABLE IF EXISTS `zy_player`;

CREATE TABLE `zy_player` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `NickName` varchar(50) DEFAULT NULL COMMENT '微信昵称',
  `Openid` varchar(50) DEFAULT NULL COMMENT '微信openID',
  `HeadImg` varchar(250) DEFAULT NULL COMMENT '微信头像',
  `Status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0是，1是',
  `AddTime` int(12) DEFAULT NULL,
  `TotalGold` int(12) NOT NULL DEFAULT '0' COMMENT '总金币',
  `MusicSet` int(1) DEFAULT '1' COMMENT '背景音乐设置',
  `EffectsSet` int(1) DEFAULT '1' COMMENT '音效设置',
  `ReadAgain` tinyint(1) DEFAULT '1' COMMENT '默认是显示规则',
  `UpdateTime` int(12) DEFAULT NULL COMMENT '最新登录时间',
  PRIMARY KEY (`id`),
  KEY `NewIndex1` (`Openid`,`Status`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

